import React from 'react';
import { NavLink } from 'react-router-dom';
import SearchBar from './search';
import Theme from '../feature/theme/theme';

const Navigation = () => {
    return (
        <nav>
            <NavLink 
                to='/'
                className={({ isActive }) => isActive ? 'active' : ''}
            >work</NavLink>
            <NavLink 
                to='/play'
                className={({ isActive }) => isActive ? 'active' : ''}
            >play</NavLink>
            <NavLink 
                to='/about'
                className={({ isActive }) => isActive ? 'active' : ''}
            >about</NavLink>
            <SearchBar />
            <Theme />
        </nav>
    );
};

export default Navigation;
